import React from 'react';

const BookCompletion = () => (
    <div className="completion">
      <div className="round">
        <img alt="progress" />
      </div>
      <div>
        <h2>83%</h2>
        <p>In Progress</p>
      </div>
    </div>
  );


export default BookCompletion;
